import React, { Component } from 'react';
import logo from './jamiedesignedfinal.svg';
// import logo from './jamiedesignedfinal-color.svg';
import './App.css';


var HoverTest = React.createClass({
    getInitialState: function(){
        return {
            hover: false
        };
    },
    hoverOn: function(){
      this.setState({ hover: true });
    },
    hoverOff: function(){
      this.setState({ hover: false });
    },
    render: function() {
        return (
          <i
            className={ this.state.hover ? "fa fa-heart" : "fa fa-heart-o"}
            onMouseEnter={this.hoverOn}
            onMouseLeave={this.hoverOff}
          >
           {" "} My class is: { this.state.hover ? "fa-heart" : "fa-heart-o"}
          </i>
        );
    }
});

ReactDOM.render(<HoverTest name="World" />, document.getElementById('container'));
class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header section-padding">
          <img src={logo} className="App-logo" alt="logo" />
        </header>

        <footer>
           <div className="cities section-padding">
             <h3>Tokyo</h3>
             <h3>|</h3>
             <h3>Dubai</h3>
             <h3>|</h3>
             <h3>Warwick</h3>
          </div>
            <div id="enter"><a href=""> Enter</a></div>
        </footer>
      </div>
    );
  }


}

export default App;
